column8:
油圧式でらくらくジャッキアップ！ 約3500Kgまで対応できるフロアジャッキです。 キャスター・ハンドル付きだから手軽に扱える上、 少ない力で車体がぐんぐん持ち上がって作業もすばやく行えます。 タイヤ・チェーン・ホイール等の脱着に！ ■ローダウン車に最適！最低地上高約70mm～ 515mmまで対応。 ■デュアルピストン（デュアルポンプ）採用によりスムーズな動作が可能！ ■2分割式ハンドルタイプ  ■滑り止め効果ゴムパットが標準装備。■2分割式ハンドルタイプ　ジャッキ本体34Kg。 梱包重量37kg。

ジャッキ フロアジャッキ ガレージジャッキ ジャッキスタンド ジャッキアップ 油圧 油圧ジャッキ　
低床 ローダウンガレージジャッキ ローダウン車 愛車の整備 タイヤ交換<style type="text/css">
