エアータッチ前の下地作りに<br><br><br>4ステップで下地作りOK！仕上がりに差！<br>使いやすいキューブ型でササクレを研磨し塗装下地を作ります。<br><br><br>【特徴】<br>塗装の下地作りがコレひとつで完了するサンドペーパー。<br>四角の面にそれぞれ番手の違うサンドペーパーを配置しているので、順番に使うだけで塗装前に必要な下地作りが完了します。 <br>また、サンドペーパーの研磨面に用途と番手が印刷されているので、サンドペーパーを使ったことの無い方でも迷うことなく使用することができます。<br>研磨状態が一目瞭然となる水切りワイパー機能も搭載しています。<br><br><br>【仕様】<br>サンドペーパー種類：240番、400番、600番、800番<br>補修可能範囲：10cm×10cm<br>個数：1個<br><br>メーカー：ソフト99/SOFT99 99工房<style type="text/css">
