エアータッチの前に使うキズ埋め剤！<br><br><br>小さなキズを埋め、キズをよりキレイに仕上げる補修用パテです。<br>初めての補修でも、よりキレイに補修したい方や「エアータッチ」で少しえぐれたキズを補修しようと思う方におススメです。<br><br><br>【特徴】<br>太陽光線に反応して硬化するキズ埋め剤。<br>深さ2mmまでの浅いキズ埋めが、超スピーディに！<br>小キズに使いやすい「極細とんがりノズル」を採用し、初めての方でもカンタンにキズ埋めが可能。<br>盛り上げ過ぎたパテは、付属のヘラでサッとしごき取ればOK。<br>硬化後に付属のサンドペーパーで研磨すればさらにキレイな仕上がりに。<br>鋼板、防錆鋼板、アルミ、PP、FRPなど、金属～樹脂まで幅広い素材に密着し、ボディはもちろん、樹脂バンパーの小キズ補修にとても便利です。<br><br><br>【仕様】<br>成分：アクリル・エポキシ系樹脂<br>適合素材：鋼板、亜鉛鋼板、アルミ、FRP、PPなど<br>セット内容：パテ12g、ヘラ、耐水サンドペーパー（800番：1枚）<br>内容量：12g<br><br>メーカー：ソフト99/SOFT99 99工房<style type="text/css">
